My_Average_Win_Size_1.query:
q = load "Load_opty_services_acct_all";
{{cell(OptyRoleToggle_1.selection, 0, "saql_filter").asString()}}"{{cell(UserData.selection, 0, "Id").asString()}}";
q = filter q by 'OpportunityServices__c.StageName' == "Closed Won";
q = filter q by 'OpportunityServices__c.gCRM_Amount_USD__c' > 0;
q = group q by ('OpportunityServices__c.gCRM_Opportunity_ID__c');
q = foreach q generate sum('OpportunityServices__c.gCRM_Amount_USD__c') as 'OpportunityServices__c.gCRM_Amount_USD__c', 'OpportunityServices__c.gCRM_Opportunity_ID__c' as 'OpportunityServices__c.gCRM_Opportunity_ID__c';
q = group q by all;
q = foreach q generate sum('OpportunityServices__c.gCRM_Amount_USD__c') as 'Amount', unique('OpportunityServices__c.gCRM_Opportunity_ID__c') as 'count';
q = foreach q generate coalesce(coalesce('Amount', 0)/coalesce('count', 0), 0) as 'Amount';
q = limit q 10;

